import React from 'react';
import { Stage, Layer, Rect, Text } from 'react-konva';

import { percentageOf } from '../../utilities';
import { PAPER_341_WIDTH, PAPER_341_HEIGHT } from '../../constants';

import './styles.css';

function Individual341() {
  return (
    <Layer>
      <Rect
        x={98}
        y={95}
        width={912}
        height={680}
        stroke="black"
        strokeWidth={3}
      />
      <Text>EXCELLENCE/DISCREPENCY REPORT</Text>
    </Layer>
  );
}

function Form341() {
  return (
    <Stage
      className="Form341"
      width={PAPER_341_WIDTH}
      height={PAPER_341_HEIGHT}
    >
      <Individual341 />
    </Stage>
  );
}

export default Form341;
